import * as React from "react";
import './hambergurCSS.css';
import {Form, Modal, Table} from "react-bootstrap";
import {Link} from "react-router-dom";
import * as times from "./data/calendar";
import {CirclePicker} from "react-color";
import Button from "./components/Button";
import * as data from "./data/courses";
import * as data1 from "./data/courses2";

class hamburger extends React.Component {
	constructor(props){
		super(props);
		this.state = {
			show: false,
			show1: false,
			rubiat: false,
			colorS: false,
			isLoading: true,
			lectures: null,
			labs: null,
			tutorials: null,
			dataCourses: null,
			Courses: null,
			coursesFall: null,
			coursesWinter: null,
			coursesSummer: null,
			coursesTaken: null,
			coursesTakenSet: null,
			loggedIn: false,
			semester: null,
			year: null,
			weekdays: ["Monday", "Tuesday", "Wednesday", "Thursday", "Friday"],
			credits: 0,
			//classes: JSON.parse(JSON.stringify(data.sequence)),

			colors: [
				["#f44336", 0],
				["#e91e63", 0],
				["#4caf50", 0],
				["#795548", 0],
				["#03a9f4", 0],
				["#3f51b5", 0],
				["#607d8b", 0]
			],

			addedClasses: [],

			courses: JSON.parse(JSON.stringify(data.default.sequence)),
			courses2: JSON.parse(JSON.stringify(data1.default.sequence)),
			selectedCourses: [],
			show2: "hidden",

			colorOfNewClass: [],

			showUpload: false,

			uploadedFile: null,

			defaultValueLecture: "",
			defaultValueLab: "",
			defaultValueTutorial: "",

			showSelection: "block",
			showSchedule: "none",
			showConflict: "hidden",
			showTryAll: "hidden",
			tryAllIndex: 0,
			validTryAll: [],

			finalizedClassArray: [],
			showConflictForFinalize: false,
		};
	}

	render(){
		const myStyle = {
			backgroundColor: "red",
			display : "inline-block",
		};
		var forEach=function(t,o,r){if("[object Object]"===Object.prototype.toString.call(t))for(var c in t)Object.prototype.hasOwnProperty.call(t,c)&&o.call(r,t[c],c,t);else for(var e=0,l=t.length;l>e;e++)o.call(r,t[e],e,t)};

		var hamburgers = document.querySelectorAll(".hamburger");
		if (hamburgers.length > 0) {
			forEach(hamburgers, function(hamburger) {
				hamburger.addEventListener("click", function() {
					this.classList.toggle("is-active");
				}, false);
			});
		}
		return(
			
			<div style={myStyle}>
			<button className="hamburger hamburger--squeeze" type="button">
			<span className="hamburger-box">
			<span className="hamburger-inner">
			</span>
	</span><p>Hey</p>
	</button>
	</div>
		)
	}
}

export default hamburger;
